import { View, Text, Image, FlatList, TouchableOpacity } from 'react-native'
import React, { useLayoutEffect } from 'react'
import { useNavigation } from '@react-navigation/native'
import { Ionicons } from '@expo/vector-icons';

const OrderScreen = () => {
    const navigation = useNavigation();
    useLayoutEffect(() => {
        navigation.setOptions({
            headerShown: false,
        });
    }, []);

    const handleBackPress = () => {
        navigation.goBack();
    };
    return (
        <View className="flex-1 bg-white">
            <View className="flex-row bg-[#FF6813] h-12">
                <View className="mt-2">
                    <TouchableOpacity onPress={handleBackPress}>
                        <Ionicons name="arrow-back" size={34} color="white" />
                    </TouchableOpacity>
                </View>
                <View className=" flex-1  items-center justify-center mr-6" >
                    <Text className="text-[20px] text-[#fff] font-semibold">ĐẶT CHỖ</Text>
                </View>
            </View>
            <View className="px-2 mt-2">
                <Image source={require('../assets/haisan.jpg')} className="max-w-full h-[200px]" resizeMode="stretch" />
            </View>


        </View>
    )
}

export default OrderScreen
